/*help modal*/
.help-modal {
  background-color: #ffffff;
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  box-shadow: 0 0 20px #bbb;
  width: 430px;
  height: 170px;
  right: 0;
  top: 150px;
  display: none;
  padding: 16px 16px 4px 16px;
  color: #333333;
  box-sizing: border-box;
}
.help-modal .header {
  text-align: center;
}
.help-modal-logo {
  width: 70px;
  height: 24px;
}
.xviz-icon-full {
  background-repeat: no-repeat;
