  background-image: url('data:image/svg+xml;base64,');
}
.help-modal h3 {
  font-size: 18px;
  font-weight: 400 !important;
  padding-left: 15px;
  margin: 0;
}
.ratings {
  display: inline;
}
.help-modal .close-modal {
  position: absolute;
  right: 16px;
  top: 16px;
  cursor: pointer;
  font-size: 14px;
  width: 20px;
  height: 20px;
  background-image: url('data:image/svg+xml;base64,');
}
.section {
  float: left;
  width: 33.33%;
}
.section .section-label {
  font-size: 14px;
  line-height: 14px;
  text-transform: uppercase !important;
  font-weight: 500 !important;
}
.help-link {
  display: block;
  font-size: 12px;
  text-decoration: none;
  box-shadow: none !important;
  color: #333333;
  line-height: 24px;
}
.licence-section {
  font-size: 12px;
  box-shadow: none !important;
  color: #333333;
}
.modal-footer {
  border-top: 1px solid #eaeaea;
  margin-top: 14px;
}
.modal-footer > p {
  font-size: 12px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
  font-weight: 400 !important;
  display: inline-block;
  width: 50%;
}
.copyright {
  text-align: right;
}
.bold {
  font-weight: bold;
}
.vbi-licence-body,
.modal-footer {
  float: left;
  width: 100%;
}
.help-modal {
  float: left;
}
@media (max-width: 480px) {
