/* ------------------------------Alert --------------------------------------------------- */
.d2VDT-alert-container {
  position: fixed;
  font-family: Arial, Helvetica, sans-serif;
  font-size: 14px;
}
@keyframes bottom-right {
  0% {
    right: -250px;
    bottom: 0px;
  }
  100% {
    right: 1px;
    bottom: 1px;
  }
}
@keyframes bottom-left {
  0% {
    left: -250px;
    bottom: 0px;
  }
  100% {
    left: 1px;
    bottom: 1px;
  }
}
@keyframes top-left {
  0% {
    left: -250px;
    top: 0px;
  }
  100% {
    left: 1px;
    top: 1px;
  }
}
@keyframes top-right {
  0% {
    right: -250px;
    top: 0px;
  }
  100% {
    right: 1px;
    top: 1px;
  }
}
.alert-box {
  display: flex;
  align-items: center;
  width: auto;
  height: 35px;
  background-position: 15px center;
  box-shadow: 0 0 12px #999;
  background-repeat: no-repeat;
  color: white;
}
.alert-msg {
  display: flex;
  align-items: center;
  padding: 10px;
  width: auto;
  opacity: 1;
  min-width: 100px;
}
.alert-box.loading {
  background-color: black;
}
.alert-box.success {
  background-color: #43A047;
}
.alert-box.error {
  background-color: #d32f2f;
}
.alert-icon {
  font-size: 16px;
  padding-left: 10px;
}
.alert-icon.loading::before {
  content: "\F148";
  font-family: 'VDT-icons';
}
.alert-icon.success::before {
  content: "\F146";
  font-family: 'VDT-icons';
}
.alert-icon.error::before {
  content: "\F147";
  font-family: 'VDT-icons';
}
.d2VDT-alert-container.transition {
  -webkit-animation-duration: 0.5s;
  animation-duration: 0.5s;
}
.d2VDT-alert-container.top-right {
  -webkit-animation-name: top-right;
  animation-name: top-right;
  top: 1px;
  right: 1px;
}
.d2VDT-alert-container.top-left {
  -webkit-animation-name: top-left;
  animation-name: top-left;
  top: 1px;
  left: 1px;
}
.d2VDT-alert-container.bottom-left {
  -webkit-animation-name: bottom-left;
  animation-name: bottom-left;
  bottom: 1px;
  left: 1px;
}
.d2VDT-alert-container.bottom-right {
  -webkit-animation-name: bottom-right;
  animation-name: bottom-right;
  bottom: 1px;
  right: 1px;
}
.alert-close {
  height: 24px;
  width: 24px;
  padding: 2px;
  border: inherit;
  z-index: 112;
  right: 0;
  top: 0;
  opacity: 0.7;
  display: flex;
  align-items: center;
  justify-content: center;
  transition: 0.2s all;
}
.alert-close:hover {
  opacity: 1;
  background-color: #F4F4F4;
  cursor: pointer;
}
.alert-close img {
  height: 12px;
  width: 12px;
}
