  src: url(data:font/woff;charset=utf-8;base64,) format("woff");
}
@font-face {
  font-family: "VDT-Table-icons";
  src: url(data:font/woff;charset=utf-8;base64,) format("woff");
}
* {
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
}
.d2VDT {
  position: relative;
  color: #666;
  cursor: all-scroll;
  overflow: hidden;
  height: 100%;
  width: 100%;
  /* font-family: Arial, Helvetica, sans-serif; */
  font-size: 1rem;
  /*	-webkit-overflow-scrolling: show; 	*/
}
.d2VDT * {
  box-sizing: content-box;
}
.d2VDT p {
  font-weight: 400;
  font-size: 12px;
}
.d2VDTPopUpBg {
  /* font-family: Arial,Helvetica,sans-serif; */
  font-size: 1rem;
}
.d2VDTPopUpBg * {
  box-sizing: content-box;
  line-height: initial;
}
.d2VDT .d2VDTCtr {
  position: absolute;
  top: 0px;
  left: 0px;
  right: 0px;
  bottom: 0px;
  overflow: hidden;
}
