/* ---------------------------------- */
/* --- Scenario Comparison Pop Up --- */
/* ---------------------------------- */
.d2VDTPopUpBg .d2VDTScenarioBg {
  position: absolute;
  top: 10px;
  left: 10px;
  right: 10px;
  bottom: 10px;
  box-shadow: 1px 1px 3px rgba(0, 0, 0, 0.4);
  background-color: rgba(255, 255, 255, 0.9);
}
.d2VDTScenarioBg .d2VDTClose {
  display: inherit !important;
  line-height: 35px;
  text-align: center;
  position: absolute;
}
.d2VDTScenario {
  font-size: 12px !important;
  color: #666;
  /*	position:relative; */
  overflow-y: hidden !important;
  overflow-x: hidden !important;
  -webkit-overflow-scrolling: auto !important;
  top: 10px;
  left: 10px;
  right: 0px;
  bottom: 0px;
  position: absolute;
}
.d2VDTScenarioTable {
  left: 0px;
  right: 0px;
  top: 50px;
  bottom: 0px;
  position: absolute;
}
.d2VDTScenarioTable .swapScenarioIcon::before {
  font-family: "VDT-icons";
  content: "\F135";
  color: #0078d4;
  margin-left: 2px;
  font-size: 14px;
}
.d2FixedTable-body.d2Scroll {
  position: static;
}
.d2FixedTable-body.d2Scroll {
  overflow-x: auto !important;
  overflow-y: auto;
  float: left;
}
.d2FixedTable table {
  width: auto;
  border-collapse: collapse;
}
.d2FixedTable td,
.d2FixedTable th {
  padding: 0px;
  overflow-x: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
  text-align: center;
}
/* Set Width of Sidebar and related measures: */
.d2FixedTable-header {
  margin-left: 220px;
  overflow: hidden;
}
.d2FixedTable-sidebar {
  /*  width: 250px; */
  float: left;
  overflow: hidden;
}
.d2FixedTable-sidebar .valueItem .d2VDTIconButton {
  position: absolute;
  top: 0;
  right: 0;
  font-size: 14px;
}
.d2FixedTable-sidebar .valueItem .d2VDTIconButton:hover {
  color: #0078d4;
}
.d2FixedTable-sidebar div {
  width: 210px;
  padding: 0 5px;
}
.d2FixedTable-header,
.d2FixedTable-body {
  width: 80%;
  width: calc(100% - 221px);
}
/* Set table cell formatting for scenarios: */
.d2FixedTable .scenarioHeader {
  margin-top: 5px;
  border-top-left-radius: 10px;
  border-top-right-radius: 10px;
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
}
.d2FixedTable .scenarioHeader .swapScenarioIcon {
  padding-left: 4px;
  position: absolute;
  right: 10px;
}
.d2FixedTable .scenarioHeader .swapScenarioIcon:hover {
  cursor: pointer;
  opacity: 0.8;
}
.d2FixedTable .scenarioFooter {
  margin-bottom: 5px;
  border-bottom-left-radius: 10px;
  border-bottom-right-radius: 10px;
}
.d2FixedTable .topNode {
  height: 50px;
  line-height: 50px;
}
.d2FixedTable-body .topNode {
  text-align: center;
}
.d2FixedTable .waterfall {
  height: 120px !important;
}
.d2FixedTable .textItem {
  height: 40px;
  text-overflow: ellipsis;
  font-size: 13px;
  line-height: 60px;
  opacity: 1;
}
.d2FixedTable .valueItem {
  position: relative;
  font-size: 12px;
  opacity: 0.8;
}
.d2FixedTable .d2VDTIconButton {
  margin-top: 0px;
  width: 30px;
  padding: 0;
  line-height: 30px;
  text-align: center;
}
.d2FixedTable .group {
  position: relative;
  border-top: 1px solid #ddd;
  opacity: 1;
  height: 40px;
  font-size: 13px;
  line-height: 40px;
  background-color: #ffffff;
  text-align: left;
}
.d2FixedTable .group .text {
  position: absolute;
  left: 30px;
  top: 12px;
  font-size: 14px;
}
.d2FixedTable-sidebar .group .kpi::before {
  font-family: "VDT-icons";
  content: "\F105";
}
.d2FixedTable-sidebar .group .assump::before {
  font-family: "VDT-icons";
  content: "\F104";
}
.d2FixedTable .descr {
  height: 50px;
  white-space: normal;
  line-height: 12px;
  color: #666;
}
.d2FixedTable .active {
  border-left: 5px solid rgba(46, 138, 184, 0.5);
  border-right: 5px solid rgba(46, 138, 184, 0.5);
  margin: 0px;
}
.d2FixedTable .scenario-description {
  padding-top: 15px;
  height: 100px !important;
}
.d2FixedTable .scenario-description > div {
  height: 85px !important;
  overflow-y: auto;
  line-height: 1.5;
  text-align: left;
  white-space: pre-wrap;
  /* CSS3 */
  white-space: -moz-pre-wrap;
  /* Firefox */
  word-wrap: break-word;
  /* IE */
}
/* Icons and format for best and worst */
.d2FixedTable-body div::before {
  font-family: "SAP-icons";
  font-size: 12px;
  float: left;
}
.d2FixedTable .best {
  color: #00b050;
}
.d2FixedTable .best::before {
  content: "\E1C1   ";
}
.d2FixedTable .worst {
  color: rgba(255, 0, 0, 0.8);
}
.d2FixedTable .worst::before {
  content: "\E1C8   ";
}
.d2FixedTable .scenarioHeader.active {
  border-top: 5px solid rgba(46, 138, 184, 0.5);
}
.d2FixedTable .scenarioFooter.active {
  border-bottom: 5px solid rgba(46, 138, 184, 0.5);
}
