/* Set cell sizing: */
.d2FixedTable-body div,
.d2FixedTable-header div {
  width: 210px;
  background-color: white;
  height: 30px;
  line-height: 30px;
  padding: 0 5px;
  margin: 0 5px;
  overflow: hidden;
}
.d2FixedTable-sidebar .valueItem {
  background-color: rgba(255, 255, 255, 0.8);
  height: 30px;
  line-height: 30px;
  text-align: left;
  text-overflow: ellipsis;
  overflow: hidden;
  opacity: 0.8;
}
/* Set height: */
.d2FixedTable-body,
.d2FixedTable-sidebar {
  height: 80%;
  height: calc(100% - 40px);
}
.d2VDTScenario .d2FixedTable-body tr:hover div.valueItem {
  background-color: rgba(0, 0, 0, 0.1);
}
/* ---------------------------------- */
/* --- Input Comparison Pop Up --- */
/* ---------------------------------- */
.d2VDTPopUpBg .d2VDTInputBg {
  position: absolute;
  top: 10px;
  left: 10px;
  right: 10px;
  bottom: 10px;
  box-shadow: 1px 1px 3px rgba(0, 0, 0, 0.4);
  background-color: rgba(255, 255, 255, 0.9);
}
.d2VDTInputBg .d2VDTClose {
  display: inherit !important;
  line-height: 35px;
  text-align: center;
  position: absolute;
}
.d2VDTInput {
  font-size: 12px !important;
  color: #666;
  /*	position:relative; */
  overflow-y: hidden !important;
  overflow-x: hidden !important;
  -webkit-overflow-scrolling: auto !important;
  top: 10px;
  left: 10px;
  right: 0px;
  bottom: 0px;
  position: absolute;
}
.d2VDTInputTable {
  left: 0px;
  right: 0px;
  top: 50px;
  bottom: 0px;
  position: absolute;
}
/* Column with */
.d2VDTInput .d2FixedTable-body div,
.d2VDTInput .d2FixedTable-header div {
  width: 90px;
  padding: 0px;
  margin: 0px;
}
/* Set table cell formatting for Inputs: */
.d2FixedTable .InputHeader {
  margin-top: 5px;
  border-top-left-radius: 10px;
  border-top-right-radius: 10px;
}
.d2FixedTable .InputFooter {
  margin-bottom: 5px;
  border-bottom-left-radius: 10px;
  border-bottom-right-radius: 10px;
}
.d2FixedTable .textItem {
  height: 40px;
  text-overflow: ellipsis;
  font-size: 13px;
  line-height: 60px;
  opacity: 1;
}
.d2FixedTable .valueItem {
  font-size: 12px;
  opacity: 0.8;
}
.d2FixedTable .descr {
  height: 50px;
  white-space: normal;
  line-height: 12px;
  color: #666;
}
.d2FixedTable .active {
  border-left: 5px solid rgba(46, 138, 184, 0.5);
  border-right: 5px solid rgba(46, 138, 184, 0.5);
  margin: 0px;
}
.d2FixedTable .editable {
  position: relative;
  background-color: lightYellow;
  cursor: pointer;
}
.d2FixedTable .changed {
  color: #2e8ab8;
}
.d2FixedTable .changed::before {
  content: "\E038   ";
  font-family: 'SAP-icons';
  position: absolute;
  left: 5px;
}
.d2FixedTable .editable input {
  position: absolute;
  font-size: 12px;
  text-align: center;
  background-color: transparent;
  left: 0;
  width: 100%;
  height: 100%;
  border: none;
  color: transparent;
}
.d2FixedTable .editable input:focus {
  background-color: yellow;
  color: black;
}
.d2FixedTable .editable input::selection {
  background: rgba(0, 0, 0, 0.1);
}
.d2FixedTable .editable select {
  position: absolute;
  font-size: 12px;
  padding-left: 15px;
  background-color: transparent;
  left: 0;
  width: 100%;
  height: 100%;
  border: none;
}
/* Icons and format for best and worst */
.d2FixedTable-body div::before {
  font-family: "SAP-icons";
  font-size: 12px;
  float: left;
}
.d2FixedTable .best {
  color: #00b050;
}
.d2FixedTable .best::before {
  content: "\E1C1   ";
}
.d2FixedTable .worst {
  color: rgba(255, 0, 0, 0.8);
}
.d2FixedTable .worst::before {
  content: "\E1C8   ";
}
.d2FixedTable .InputHeader.active {
  border-top: 5px solid rgba(46, 138, 184, 0.5);
}
.d2FixedTable .InputFooter.active {
  border-bottom: 5px solid rgba(46, 138, 184, 0.5);
}
/* ------------------ */
/* --- Separator --- */
/* ------------------ */
.d2VDTSep::before {
  font-family: "SAP-icons";
  content: "\E1ED";
  padding: 0 8px 0 10px;
}
/* ------------------ */
/* --- Close Icon --- */
/* ------------------ */
.d2VDTClose {
  background-color: transparent !important;
  border-color: transparent !important;
  box-shadow: none;
  line-height: 16px;
  -moz-box-shadow: none;
  -webkit-box-shadow: none;
  cursor: pointer;
  height: 55px;
  width: 55px;
}
div.d2VDTClose {
  display: none;
  top: 0px;
  right: 0px;
}
.d2VDTClose::before {
  font-family: "SAP-icons" !important;
  font-size: 16px !important;
  color: #999 !important;
  content: "\E03E   ";
}
