/* -------------------------*/
/* --- Chart SVG Styles --- */
/* -------------------------*/
.baseBar {
  fill: none;
  stroke: #2e8ab8;
  stroke-dasharray: 1, 2;
  stroke-width: 1px;
  shape-rendering: crispEdges;
  cursor: pointer;
}
.bar {
  fill: #bbb;
  fill-opacity: 0.75;
  cursor: pointer;
}
.bar.current {
  fill: #3399CC;
}
.bar.future {
  fill: #dedede;
}
.bar.neg {
  fill: #ff0000;
  fill-opacity: 0.7;
}
.bar.pos {
  fill: #00b050;
  fill-opacity: 0.7;
}
.barLabel {
  fill: #666;
  font-family: AvenirNextCondensed-Regular, Arial Narrow, Arial, Helvetica, sans-serif;
  font-size: 10px;
}
.line {
  fill: none;
  stroke: #2e8ab8;
  stroke-width: 1px;
  /*  shape-rendering: crispEdges; */
  stroke-linecap: "round";
}
.avg {
  fill: none;
  stroke-width: 0.5px;
  stroke: #999;
  stroke-dasharray: 5, 10;
  shape-rendering: crispEdges;
}
.axis {
  fill: #666666;
  font-family: AvenirNextCondensed-Regular, Arial Narrow, Arial, Helvetica, sans-serif;
  font-size: 10px;
}
.axis .domain {
  opacity: 0;
}
.dlg {
  top: 0px;
  position: absolute;
  width: 100%;
  height: 100%;
  text-align: center;
  color: white;
  line-height: 300px;
  background-color: rgba(0, 0, 0, 0.6);
}
/* -------------------------------------------------------------- */
/* Details Panel 														  */
/* -------------------------------------------------------------- */
/* The Detail is "zooming" a tile to full screen and is generally re-writting styles to fit the full screen form factor */
/* For wide panels, we use a fixed layout to get the most out of the real-estate:
   We can't use a responsive layout as what is important is the width of the panel and 
   not the width of the screen. Class wide is dynamically added to the 
   d2VDTDetailBg container and is used to redefine the layout.
*/
.d2VDTPopUpBg {
  position: absolute;
  display: none;
  left: 0px;
  right: 0px;
  top: 0px;
  bottom: 0px;
  background-color: rgba(0, 0, 0, 0.7);
  z-index: 1;
}
.d2VDTDetailBg {
  position: absolute;
  background-color: rgba(255, 255, 255, 0.95);
  top: 0px;
  left: 0px;
  right: 0px;
  bottom: 0px;
  z-index: 1;
}
.d2VDTPopUpBg .d2VDTDetailBg {
  top: 10px;
  left: 10px;
  right: 10px;
  bottom: 10px;
  box-shadow: 1px 1px 3px rgba(0, 0, 0, 0.4);
}
.d2VDTDetailBg .d2Scroll {
  left: 35px;
}
.wide.d2VDTDetailBg .d2Scroll {
  left: 0;
}
.d2VDTDetail {
  font-size: 12px;
  color: #666;
  position: relative;
  overflow-y: hidden !important;
  overflow-x: hidden !important;
  -webkit-overflow-scrolling: auto !important;
  min-height: 650px;
  width: 100%;
}
.d2VDTDetail p {
  font-weight: 400;
  font-size: 12px;
}
.wide .d2VDTDetail {
  position: absolute;
  height: 100%;
}
.wide .d2VDTDetail div {
  position: absolute;
}
.d2VDTDetailBg .d2VDTClose {
  display: inherit !important;
  line-height: 35px;
  text-align: center;
  position: absolute;
}
.d2VDTHeader {
  font-size: 12px;
  line-height: 25px;
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: pre;
  color: rgba(255, 255, 255, 0.8);
  top: 0px;
  left: 45px;
  color: #999;
}
.d2VDTTitle {
  /* font-family: Arial, Helvetica, sans-serif !important;   */
  overflow: hidden;
  vertical-align: top;
  font-size: 25px !important;
  font-weight: normal !important;
  line-height: 25px;
  height: 50px;
  width: 100%;
}
.wide .d2VDTTitle {
  top: 35px;
  left: 45px;
  right: 43%;
  width: auto;
}
.d2VDTDetail h3 {
  font-size: 16px;
  color: #666;
  text-align: left;
  font-weight: normal;
  margin: 16px 0 0 0;
}
/* Primary Value */
.d2VDTValue {
  font-weight: 100;
  -webkit-font-smoothing: antialiased;
  line-height: 40px;
  font-size: 40px;
  text-align: right;
  right: 0px;
  height: 40px;
  position: inherit !important;
}
.d2VDTChildCount {
  font-weight: 600;
  font-size: 10px !important;
}
.d2VDTValue.enumvalue {
  height: auto;
  font-size: 30px;
  line-height: normal;
}
.d2VDTPrefix,
.d2VDTSuffix {
  font-size: 18px;
}
.d2VDTStatusGreen .d2VDTValue {
  color: #00b050;
}
.d2VDTStatusAmber .d2VDTValue {
  color: #ffc000;
}
.d2VDTStatusNeutral .d2VDTValue {
