/* 
Navpanel collapse and uncollapse style
*/
.nav-container .d2VDTNavCollapse {
  position: absolute;
  left: 302px;
  display: none;
  align-items: center;
  justify-content: center;
}
.nav-container .d2VDTNavCollapseButton {
  cursor: pointer;
  top: 66px;
  z-index: 1;
  border: 0.5px solid #505050;
  border-radius: 50%;
  padding: 2px;
  width: 24px;
  height: 24px;
  background: #333;
  box-shadow: 0 0 0 1px rgba(9, 30, 66, 0.08), 0 2px 4px 1px rgba(9, 30, 66, 0.08);
  text-align: center;
  color: white;
}
.nav-container .d2VDTNavCollapse.navToggle::before {
  margin: 0;
  font-size: 10px;
  transform: rotate(-90deg);
}
.nav-container .d2VDTNavExpand.navToggle::before {
  margin: 0;
  font-size: 10px;
  transform: rotate(90deg);
}
.nav-container .d2VDTNavCollapse:hover {
  display: flex;
  background-color: #4f4f4b;
}
.d2VDTNavBg:hover ~ .d2VDTNavCollapse {
  display: flex;
}
.nav-container .d2VDTNavCollapse.hideToggle {
  transform: translateX(-302px);
  transition: transform 300ms linear;
}
.nav-container .d2VDTNavCollapse.showToggle {
  transform: translateX(0px);
  transition: transform 300ms linear;
}
.nav-container .removeChildDiv > div {
  display: none !important;
}
.tree-container.slideCanvas {
  width: calc(100% - 20px);
  transform: translateX(-302px);
  transition: transform 300ms linear;
}
.tree-container.returnCanvas {
  width: 100%;
  transform: translateX(0px);
  transition: transform 300ms linear;
}
